var cpt_active = 0;
var cpt_green = 0;
var array = [];
var word_to_find = liste[Math.floor(Math.random()*liste.length)];



function init(){  
    /* Initialise the board */ 
    parent = document.getElementById("playboard")
    let cpt = 0

    for(i=0; i<5; i++){
        word = document.createElement("div");
        word.className = "words";
        parent.appendChild(word);
        for(j=0; j<5;j++){
            cell = document.createElement("div")
            cell.className = "cell"
            cell.id = cpt
            word.appendChild(cell)
            cpt++;
        }
    document.getElementById(cpt_active).classList.add("active");
    /*
    text = document.createElement("input");
    text.type = "text";
    text.className = "letters";
    text.id = "letter_" + String(cpt);
    cell.appendChild(text)
    */
    }
}

function find(alphabet, key){
    for(i=0;i<26;i++){
        if(alphabet[i] == key){
            return i
        }
    }
    return -1

}

function compare(word, word_to_find){
    
    for(i=0; i< word.length; i++){
        document.getElementById(cpt_active-5+i).style.backgroundColor = "Gray"
        console.log(word[i], word_to_find[i])
        if(word[i] == word_to_find[i]){
            document.getElementById(cpt_active-5+i).style.backgroundColor = "Green"
            
            
            cpt_green++;
        }
        else{
            for(j=0; j<word.length; j++){
                if(i!= j && word[i] == word_to_find[j]){
                    document.getElementById(cpt_active-5+i).style.backgroundColor = "Orange"
                }
            }
        }
        document.getElementById(cpt_active-5+i).style.animation = "rotation 1s linear";
    }
}

function check(array){
    word = ""
    for(i=0; i< array.length; i++){
        word += array[i]
    }
    if(TOUS.includes(word)){
        compare(word, word_to_find)
        return true
    }else{
        return false
    }
}

document.addEventListener("keydown", (event) => {
    if(event.key == "Backspace" && array.length > 0){
        if(array.length != 5){
        document.getElementById(cpt_active).classList.remove("active");
        }
        cpt_active--;
        document.getElementById(cpt_active).classList.add("active");
        document.getElementById(cpt_active).innerText = null;
        array.pop();

    }
    else if(find(alphabet, event.key.toUpperCase()) != -1 && array.length < 5){
        array.push(event.key.toUpperCase())
        document.getElementById(cpt_active).classList.remove("active");
        document.getElementById(cpt_active).innerHTML = "<p>" + String(event.key.toUpperCase()) + "</p>";
        cpt_active++;
        if(array.length != 5){
            document.getElementById(cpt_active).classList.add("active");
        }
    }
    else if(event.key == "Enter" && array.length == 5){
        if(check(array)){
            if(cpt_green==5){
                document.getElementById("gagne").classList.add("active")
                document.getElementById("overlay").classList.add("show")
            }else{
                if(cpt_active != 25){
                document.getElementById(cpt_active).classList.add("active");
                array = [];
                cpt_green = 0;
                }else{
                    document.getElementById("overlay").classList.add("show")
                    setTimeout( function () {
                    document.getElementById("perdu").classList.add("active");
                    document.querySelector("#mot").innerHTML = word_to_find;
                    }, 1000)
                }

            }}
        }
});


